function CreateCritters(critter_number)
	local RandomX = 0
	local RandomY = 0
	local Count = 0
	-- create critters
	Count = critter_number
	while (Count > 0) do
		RandomX = SyncRand(Map.Info.MapWidth)
		RandomY = SyncRand(Map.Info.MapHeight)
		if (GetTileTerrainHasFlag(RandomX, RandomY, "land") and GetTileTerrainHasFlag(RandomX, RandomY, "unpassable") == false) then
			unit = CreateUnit("unit-critter", 15, {RandomX, RandomY})
			Count = Count - 1
		end
	end
end

function CreateGryphons(gryphon_number)
	local RandomX = 0
	local RandomY = 0
	local Count = 0

	Count = gryphon_number
	while (Count > 0) do
		RandomX = SyncRand(Map.Info.MapWidth)
		RandomY = SyncRand(Map.Info.MapHeight)
		if (GetTileTerrainHasFlag(RandomX, RandomY, "rock")) then -- gryphons appear preferentially on mountainous parts
			local unit_quantity = 0
			for i=0,14 do
				unit_quantity = unit_quantity + GetNumUnitsAt(i, "any", {RandomX - 8, RandomY - 8}, {RandomX + 8, RandomY + 8})
			end

			if (unit_quantity < 1) then -- gryphons don't like much being near inhabited areas
				unit = CreateUnit("unit-gryphon", 15, {RandomX, RandomY})
				Count = Count - 1
			end
		end
	end
end

function CreateDecorations()

	local RandomX = 0
	local RandomY = 0
	local Count = 0
	local RandomNumber = 0

	local decoration_count = GetNumUnitsAt(-1, "unit-mushroom", {0, 0}, {256, 256}) + GetNumUnitsAt(-1, "unit-flowers", {0, 0}, {256, 256}) + GetNumUnitsAt(-1, "unit-twigs", {0, 0}, {256, 256}) + GetNumUnitsAt(-1, "unit-bones", {0, 0}, {256, 256}) + GetNumUnitsAt(-1, "unit-large-flower", {0, 0}, {256, 256}) + GetNumUnitsAt(-1, "unit-fern", {0, 0}, {256, 256}) + GetNumUnitsAt(-1, "unit-log", {0, 0}, {256, 256}) + GetNumUnitsAt(-1, "unit-wyrm-skeleton", {0, 0}, {256, 256}) + GetNumUnitsAt(-1, "unit-small-rocks", {0, 0}, {256, 256}) -- mushroom patch not listed here since it occurs in many maps through normal generation
	Count = (Map.Info.MapWidth * Map.Info.MapHeight) / 128
	if (decoration_count == 0 and GetTileTerrainFlagCount("land") > Count) then
		while (Count > 0) do
			RandomX = SyncRand(Map.Info.MapWidth)
			RandomY = SyncRand(Map.Info.MapHeight)
			if (GetTileTerrainHasFlag(RandomX, RandomY, "land") and GetTileTerrainHasFlag(RandomX, RandomY, "unpassable") == false and GetNumUnitsAt(15, "any", {RandomX, RandomY}, {RandomX, RandomY}) < 1) then
				RandomNumber = SyncRand(1000)
				if (RandomNumber < 200) then
					unit = CreateUnit("unit-mushroom-patch", 15, {RandomX, RandomY})
					Count = Count - 1
				elseif (RandomNumber >= 200 and RandomNumber < 300) then
					if (wyrmsun.tileset ~= "dungeon" and wyrmsun.tileset ~= "cave") then
						unit = CreateUnit("unit-flowers", 15, {RandomX, RandomY})
						Count = Count - 1
					end
				elseif (RandomNumber >= 300 and RandomNumber < 400) then
					if (wyrmsun.tileset ~= "dungeon" and wyrmsun.tileset ~= "cave") then
						unit = CreateUnit("unit-large-flower", 15, {RandomX, RandomY})
						Count = Count - 1
					end
				elseif (RandomNumber >= 400 and RandomNumber < 600) then
					unit = CreateUnit("unit-small-rocks", 15, {RandomX, RandomY})
					Count = Count - 1
				elseif (RandomNumber >= 600 and RandomNumber < 800) then
					if (wyrmsun.tileset ~= "dungeon" and wyrmsun.tileset ~= "cave") then
						unit = CreateUnit("unit-twigs", 15, {RandomX, RandomY})
						Count = Count - 1
					elseif (wyrmsun.tileset == "dungeon" and GetTileTerrainName(RandomX, RandomY) == "floor") then
						unit = CreateUnit("unit-floor-decoration", 15, {RandomX, RandomY})
						Count = Count - 1
					end
				elseif (RandomNumber >= 800 and RandomNumber < 875) then
					if (wyrmsun.tileset ~= "dungeon" and wyrmsun.tileset ~= "cave") then
						unit = CreateUnit("unit-fern", 15, {RandomX, RandomY})
						Count = Count - 1
					end
				elseif (RandomNumber >= 875 and RandomNumber < 900) then
					if (wyrmsun.tileset ~= "dungeon" and wyrmsun.tileset ~= "cave") then
						unit = CreateUnit("unit-log", 15, {RandomX, RandomY})
						Count = Count - 1
					end
				elseif (RandomNumber >= 900 and RandomNumber < 999) then
					unit = CreateUnit("unit-bones", 15, {RandomX, RandomY})
					Count = Count - 1
				elseif (RandomNumber >= 999) then
					if (wyrmsun.tileset == "swamp") then
						unit = CreateUnit("unit-wyrm-skeleton", 15, {RandomX, RandomY})
						Count = Count - 1
					else
						unit = CreateUnit("unit-bones", 15, {RandomX, RandomY})
						Count = Count - 1
					end
				end
			elseif (GetTileTerrainName(RandomX, RandomY) == "dwarf-closed-wall" and GetNumUnitsAt(15, "any", {RandomX, RandomY}, {RandomX, RandomY}) < 1) then
				unit = CreateUnit("unit-outer-wall-decoration", 15, {RandomX, RandomY})
				Count = Count - 1
			elseif (GetTileTerrainName(RandomX, RandomY) == "dwarf-open-wall" and GetNumUnitsAt(15, "any", {RandomX, RandomY}, {RandomX, RandomY}) < 1) then
				unit = CreateUnit("unit-inner-wall-decoration", 15, {RandomX, RandomY})
				Count = Count - 1
			end
		end
	end
end

function CreatePlayers()
	-- create player units
	for i=0,14 do
		if (Map.Info.PlayerType[i] == PlayerPerson or Map.Info.PlayerType[i] == PlayerComputer) then
			local player_spawn_point = FindAppropriatePlayerSpawnPoint()
			SetStartView(i, player_spawn_point[1], player_spawn_point[2])
			SetPlayerData(i, "Resources", "gold", 10000)
			SetPlayerData(i, "Resources", "lumber", 3000)
			SetPlayerData(i, "Resources", "oil", 1000)
			local possible_civilizations = {}
			if (GetNumCivilizationPlayers("dwarf") < table.getn(GetCivilizationFactions("dwarf"))) then
				table.insert(possible_civilizations, "dwarf")
			end
			if (GetNumCivilizationPlayers("gnome") < table.getn(GetCivilizationFactions("gnome")) and GetPlayerData(i, "AiEnabled")) then
				table.insert(possible_civilizations, "gnome")
